import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

const NetFlixx = () => {
  return (
    <>
      {Sdata.map((val) => {
        return (
          <Card
            key={val.id}
            imgsrc={val.imgsrc}
            title={val.title}
            sname={val.sname}
            links={val.links}
          />
        );
      })}
    </>
  );
};

export default NetFlixx;
